import React, { useState } from 'react';
import todolist from './Images/Todolist.png';
import '../styles/Header.css';

function Header() {
  const [isPopupVisible, setIsPopupVisible] = useState(false);
  const [formSubmitted, setFormSubmitted] = useState(false);

  // Function to handle "Sign Up" button click (opens the popup)
  const handleGetStartedClick = () => {
    setIsPopupVisible(true);
    document.body.style.overflow = 'hidden'; // Prevent scrolling when popup is open
  };

  // Function to close the popup
  const closePopup = () => {
    setIsPopupVisible(false);
    setFormSubmitted(false); // Reset the form submission state when closing the popup
    document.body.style.overflow = 'auto'; // Enable scrolling again
  };

  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    setFormSubmitted(true); // Set form submission state to true
  };

  return (
    <div className="main2">
      <img src={todolist} alt="ToDo List" className="logo" />
      <div className="header">
        <div className="nav-item">About Us</div>
        <div className="nav-item">Features</div>
        <div className="nav-item">More Option</div>
        <div className="nav-item">Contact</div>
        <div className="auth-buttons">
          <button className="login-btn">Log In</button>
          <button className="signup-btn" onClick={handleGetStartedClick}>Sign Up</button>
        </div>
      </div>

      {/* Popup Form */}
      {isPopupVisible && (
        <div className="popup-overlay">
          <div className="popup">
            <button className="close-btn" onClick={closePopup}>X</button>

            {/* Check if form is submitted or not */}
            {!formSubmitted ? (
              <>
                <h2>Get Started Today!</h2>
                <p>Fill in your details and take control of your tasks.</p>
                <form className="popup-form" onSubmit={handleSubmit}>
                  <div>
                    <label htmlFor="first-name">First Name:</label>
                    <input type="text" id="first-name" name="first-name" required />
                  </div>
                  <div>
                    <label htmlFor="last-name">Last Name:</label>
                    <input type="text" id="last-name" name="last-name" required />
                  </div>
                  <div>
                    <label htmlFor="email">Email:</label>
                    <input type="email" id="email" name="email" required />
                  </div>
                  <div>
                    <label htmlFor="password">Password:</label>
                    <input type="password" id="password" name="password" required />
                  </div>
                  <button type="submit">Done</button>
                </form>
              </>
            ) : (
              <>
                <h2>Thank You!</h2>
                <p>Thank you for connecting with us. <br />Our team will be contacting you soon.</p>
                <button onClick={closePopup} className='Done'>Done</button>
              </>
            )}
          </div>
        </div>
      )}
    </div>
  );
}

export default Header;
